import styled from "styled-components";

const FooterStyle = styled.div`
  background: #fff;
  padding: 100px 400px;
  -webkit-box-shadow: 0px -11px 20px 0px rgba(209, 209, 209, 1);
  -moz-box-shadow: 0px -11px 20px 0px rgba(209, 209, 209, 1);
  box-shadow: 0px -11px 20px 0px rgba(209, 209, 209, 1);
`;

export default FooterStyle;
